import Login from './pages/Login';

import Header from "./components/Header";
import Footer from "./components/Footer";

import {BrowserRouter as Router, Route, Reoutes} from "react-router-dom";

import './App.css';

function App() {
  return (
    <div>
      <Router>
        <Header/>
        <Switch>
          <Route path = "./pages/Login.js" element={<Login/>}/>
        </Switch>
        <Footer/>
      </Router>

    </div>
  );
}

export default App;
